import React, { useState, useEffect } from "react";
import { Link } from 'react-router-dom';
import backgroundImage from '../images/background.png'; // Make sure the path is correct

const Navbar = () => {
  const [categories, setCategories] = useState([]);

  useEffect(() => {
    fetchCategories();
  }, []);

  const fetchCategories = () => {
    fetch('http://localhost:1337/categories/1')
      .then(response => response.json())
      .then(data => {
        setCategories(data);
      })
      .catch(error => console.error('Error fetching categories:', error));
  };

  return (
    <div className="navigation">
      <img src={backgroundImage} alt="Background" className="backgroundImageTwo"/>
      <div className="navLinks">
        {categories.map((category, index) => (
          <Link key={index} to={`/site/${category.c_name}`}>
            {category.c_name_rus}
          </Link>
        ))}
      </div>
    </div>
  );
};

export default Navbar;
